●主成分はエタノール、安定二酸化塩素、安定剤です。無色で特有の芳香(アルコール臭)があります。●除菌対象はサルモネラ菌、O-157、ノロウィルス、インフルエンザウィルスA型[H1N1]などです。●消臭対象は、タバコ臭、トイレ臭、ペット臭、各種腐敗臭、カビ臭、汗臭などです。●こんなところに使うと便利!(1)洗濯しづらいもの(枕、布団、カーペット、など)(2)清掃しづらい場所(便器内と周辺、車のシート[皮製は除く]やトランクルームなど)(3)より除菌効果の高いものに(ベビーカー、冷蔵庫内、まな板など)。 ●タバコ・ペットなどの気になる臭いを素早く消して、清々しい空間を作ります。●宿泊施設、高齢者福祉施設、レンタカーや中古車、ペットショップなどでの除菌・消臭用として最適です。●エタノールによる殺菌と、食品加工工程でも殺菌剤として使用されている安定化二酸化塩素の酸化分解力による二重の殺菌効果で除菌を行います。●塩素殺菌と異なり、酸素の酸化分解力による殺菌・消臭のため塩素臭が発生しません。●除菌と消臭が同時にできるため、格段に作業性が向上する上に、一般的なアルコール除菌剤より安価でコストメリットがあります。 ・火気その他着火源(静電気を含む)、から隔離してください。みだりに加熱加減圧したり、噴霧、蒸発させないでください。・アルコール分を含んでいますので、狭い部屋で大量に使用する場合は換気を充分に行ってください。・人体や動物に直接スプレーしないでください。(医薬部外品ではありません)飲用しないでください。<style type="text/css">
